syntax = "proto3";

package grpc_service_3.v1;

option java_multiple_files = true;
option java_package = "com.example.grpc_service_3";
option java_outer_classname = "GRPCServiceProto";
option go_package = "github.com/mogheyapoorv/proto-spec-gen-service3-go/grpc_service_3/v1;grpc_service_3";


message SampleRPCRequestGRPC {
}

message SampleRPCResponseGRPC {}

service ServiceMyGRPC2 {
  rpc SampleRPCAPI(SampleRPCRequestGRPC) returns (SampleRPCResponseGRPC) {}
}
